<template>
	<text class="ybVideoIconfont" :style="styleObj" v-if="enableClick" @tap="onTap">{{icons[name]}}</text>
	<text class="ybVideoIconfont" :style="styleObj" v-else>{{icons[name]}}</text>
</template>

<script>
	// #ifdef APP-NVUE
	const domModule = weex.requireModule('dom')
	// #endif
	export default {
		props: {
			name: {
				type: String,
				default: ''
			},
			size: {
				type: Number,
				default: 27
			},
			color: {
				type: String,
				default: ''
			},
			enableClick: {
				type: Boolean,
				default: false
			}
		},
		computed: {
			styleObj () {
				return this.color ? {'font-size': this.size + 'px', color: this.color} : {'font-size': this.size + 'px'}
			}
		},
		data () {
			return {
				icons: {
					'play': '\ue87c',
					'play-next': '\ue652',
					'pause': '\uea81',
					'picture-in-picture-open': '\ue96e',
					'picture-in-picture-exit': '\ue7e9',
					'play-rate-circle': '\ue608',
					'volume-muted': '\uea0f',
					'volume-medium': '\uea12',
					'volume-max': '\uea11',
					'setting': '\ue62b',
					'tv-play': '\ue6ab',
					'tv-pause': '\ue6ac',
					'barrage-show': '\ue60a',
					'barrage-hide': '\ue609',
					'in-fullscreen': '\ue625',
					'out-fullscreen': '\ue623',
					'mirror': '\ue61d'
				}
			}
		},
		beforeCreate () {
			// #ifdef APP-NVUE
				domModule.addRule('fontFace', {
					fontFamily: "ybVideoIconfont",
					src: "url('data:font/truetype;charset=utf-8;base64,')"
				})
			// #endif
		},
		methods: {
			onTap () {
				this.$emit('click')
			}
		}
	}
</script>

<style scoped>
	/* #ifndef APP-NVUE */
	@font-face {
		font-family: "ybVideoIconfont";
		src: url('data:application/x-font-woff2;charset=utf-8;base64,')
	}
	 /* #endif */
	.ybVideoIconfont {
	    font-family: ybVideoIconfont!important;
	}
</style>
